import React from "react";
import styled from "styled-components";
import "./reset.css";
import logo from "../Images/Logo-hois.svg";
import search from "../Images/Icon/search.svg";

const Nav = () => {
  return (
    <NavBar>
      <Logo />
      <Search>
        <Input />
        <SearchButton />
        <img src={search} alt="Search" />
      </Search>
      <div></div>
    </NavBar>
  );
};

const NavBar = styled.nav`
  display: flex;
  position: relative;
  width: 1040px;
  height: 70px;
  margin: 30px auto;
  padding: 10px;
`;

const Logo = styled.img.attrs({
  src: `${logo}`,
})`
  margin-right: 20px;
`;

const Search = styled.div`
  position: relative;
  margin-top: 5px;
  width: 400px;
`;

const Input = styled.input`
  position: absolute;
  z-index: 10;
  border-radius: 50px;
  border: 2px solid #0a52be;
  width: 100%;
  padding: 10px;
`;

const SearchButton = styled.img.attrs({
  src: `${search}`,
})`
  position: absolute;
  z-index: 11;
  right: 15px;
  top: 6px;
  cursor: pointer;
`;

export default Nav;
